import React from 'react';

function InputField({ input, label, type, id, meta: { touched, warning } }) {
  console.log(input, label, type, id);
  return (
    <div className='form__field'>
      <label htmlFor={id}>{label}</label>
      <input
        {...input}
        placeholder={label}
        type={type}
        className='form__field--input'
      />
      <div className='form__field--errors'></div>
    </div>
  );
}

export default InputField;
